// @mui material components
import Card from "@mui/material/Card";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";

import Grid from "@mui/material/Grid";
// import { Table } from 'react-bootstrap';
// Data
// import { Link } from "react-router-dom";
import datatable from "layouts/authentication/error/datatable";
// import datatable1 from "layouts/authentication/error/datatable1";
import datatable2 from "layouts/authentication/error/datatable2";


function DataTables() {

  const Columns =
  {

    column: [
      { Header: <h5 style={{ color: "black" }}>Scheme Name</h5>, accessor: "InvestorName", },

      { Header: <h5 style={{ color: "black" }}>No. Of STPS</h5>, accessor: "Location" },

      { Header: <h5 style={{ color: "black" }}>STP Input</h5>, accessor: "Investments" },

    ],

    rows: [
      {
        InvestorName: <h8 style={{ color: "black" }}>
        ADITYA BIRLA SUN LIFE SAVINGS FUND - GROWTH</h8>,

        Location: <h8 style={{ color: "black" }}>4</h8>,

        Investments: <h8 style={{ color: "black" }}>1,05,000</h8>,

      },

      {
        InvestorName: <h8 style={{ color: "black" }}>ICICI PRUDENTIAL ULTRA SHORT TERM FUND - GROWTH</h8>,

        Location: <h8 style={{ color: "black" }}>4</h8>,

        Investments: <h8 style={{ color: "black" }}>1,08,000</h8>,

      },


      {
        InvestorName: <h8 style={{ color: "black" }}>
          Kotak Mutual Fund	</h8>,

        Location: <h8 style={{ color: "black" }}>1</h8>,

        Investments: <h8 style={{ color: "black" }}>10,000</h8>,

      },

      {
        InvestorName: <h5 style={{ color: "green" }}>Total</h5>,

        Location: <h5 style={{ color: "green" }}>9</h5>,

        Investments: <h5 style={{ color: "green" }}>2,23,000</h5>,
      },
    ],

  };


  return (
    <DashboardLayout>
      <DashboardNavbar />

      <SuiBox p={3} style={{ backgroundColor: ' #EFFFFD', borderRadius: '15px', marginTop: "10px" }} >
        <Grid container spacing={3} alignItems="center">
          <Grid item>
            <SuiBox height="100%" mt={0.5} lineHeight={2}>
              <SuiTypography variant="h4" fontWeight="bold" style={{ color: "black", textAlign: 'center' }}>
                Overall Dashboard
              </SuiTypography>
            </SuiBox>
          </Grid>
        </Grid>
      </SuiBox>

      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Card style={{ backgroundColor: ' #D9F8C4' }}>
            <SuiBox p={2}>
              <Grid container spacing={3}>
                <Grid item xs={6} lg={2.3}>

                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total AUM" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>

                </Grid>

                <Grid item xs={6} lg={2.3}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total Purchase" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>

                <Grid item xs={6} lg={2.4}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total Redemption" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>

                <Grid item xs={6} lg={2.3}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Total Clients" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>

                <Grid item xs={6} lg={2.7}>
                  <SuiBox mb={1}>
                    <MiniStatisticsCard
                      title={{ text: "Running SIPs At Bse" }}
                      count="$53,000"
                      percentage={{ color: "success", text: "+55%" }}
                      icon={{ color: "info", component: "paid" }}
                    />
                  </SuiBox>
                </Grid>
              </Grid>
            </SuiBox>
          </Card>
        </SuiBox>
      </SuiBox>


      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Card style={{ backgroundColor: ' #BCFFB9' }}>
            <SuiBox p={2}>
              <SuiBox p={3} lineHeight={1}>
                <SuiTypography variant="h5" fontWeight="medium">
                  TOP INVESTORS AUM
                </SuiTypography>
              </SuiBox>
              <DataTable table={Columns} canSearch />
            </SuiBox>
          </Card>
        </SuiBox>
      </SuiBox>

      <SuiBox my={3}>
        <SuiBox mb={3}>
          <Card style={{ backgroundColor: ' #F5FDB0' }}>
            <SuiBox p={2}>
              <SuiBox p={3} lineHeight={1}>
                <SuiTypography variant="h5" fontWeight="medium">
                  TOP AMC AUM
                </SuiTypography>
              </SuiBox>
              <DataTable table={datatable} canSearch />
            </SuiBox>
          </Card>
        </SuiBox>
      </SuiBox>


      <SuiBox pt={6} pb={3}>
        <Card style={{ backgroundColor: ' #F7E6AD' }}>
          <SuiBox p={4} lineHeight={1}>
            <SuiTypography variant="h5" fontWeight="medium">

              CURRENT MONTH SNAPSHOT
            </SuiTypography>

          </SuiBox>
          <DataTable table={datatable2} canSearch />
        </Card>

      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default DataTables;
